import React from "react";

function AddCDM(props) {
  return (
    <div>
      <form>
        <label htmlFor="name">
          Name
          <input type="text" name="name" />
        </label>
        <label htmlFor="imgLink">
          Image Link
          <input type="text" name="imgLink" />
        </label>
      </form>
    </div>
  );
}

export default AddCDM;
